import React from "react";
import {Button, Text, TextInput, View,StatusBar, StyleSheet, FlatList, SafeAreaView } from "react-native";



const MoodBtns = ({ changeMood }) => {

  return (
    <View>
      <Button onClick={() => changeMood("lazy")} >
        Encourage Laziness
      </Button>
      <Button onClick={() => changeMood("determined")} >
        Fill with Determination
      </Button>
    </View>
  );
}

export default MoodBtns;
